As mentioned previously, a closure can access variables defined outside of its body. When this happens, it "captures" a reference to that variable for use inside the function. As a result, changes made to a captured variable persist between calls. Variable capturing can also be used to maintain a persistent state within a closure instance: even if the original variable falls out of scope, the closure still keeps it alive. # Create a function with a persistent state
{ <$foo-num = 1> # Define a function [next-foo] in the parent scope [$^next-foo] { # Modify `foo-num` from inside the function foo <$n = <foo-num>; foo-num = [add: <foo-num>; 1]; n> }
} # `foo-num` falls out of scope here, but [next-foo] can still access it # Call [next-foo] multiple times
[rep:4][sep:\n]
{ [next-foo]
}
